import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import isEmpty from 'lodash/isEmpty';
import Alert from '@mui/material/Alert';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
  // hide last border
  '&:last-child td, &:last-child th': {
    border: 0,
  },
}));

export default function StockTable({ data }) {
  return (
    <>
      {!isEmpty(data) ?
        <TableContainer component={Paper} > 
          <Table sx={{ minWidth: 650 }} aria-label="customized table" >
            <TableHead>
              <TableRow >
                <TableCell >Time</TableCell>
                <TableCell align="left" >Price</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {!isEmpty(data) && data.map((row) => (
                <TableRow
                  key={row.priceId}
                  sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                >
                  <TableCell >
                 {(new Date(row.addedDate)).toLocaleString()}

                  </TableCell>
                  <TableCell align="left">{Number(row.price).toFixed(2)}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
        :
        <Alert severity="info" >No data found! Please check the source and the price ticker.</Alert>
      }
    </>

  );
}
